        global_start = FALSE;
        return;
    }

    // Informaes SPIFFS
    Serial.println("Informaes: ");
    Serial.printf("totalBytes: %u\nusedByets: %u\nfreeBytes: %u\n",
                  SPIFFS.totalBytes(),
                  SPIFFS.usedBytes(),
                  SPIFFS.totalBytes() - SPIFFS.usedBytes());

    // Listagem de arquivos
    Serial.println("\nArquivos --------");

    if (!SPIFFS.exists("/launcher.html"))
    {
        Serial.println("Arquivo '/laucher.html' inexistente");
    }

    if (!SPIFFS.exists("/style.css"))
    {
        Serial.println("Arquivo '/style.css' inexistente");
    }

    File dir = SPIFFS.open("/");
    File file = dir.openNextFile();
    while (file)
    {
        Serial.printf(" %s - %u bytes\n", file.name(), file.size());
        file = dir.openNextFile();
    }
}

