void cntlBandeja(int status, int bandeja_RPM)
{
    switch(status){
        case ON:
            // Ativa rotao bandeja
            analogWrite(bandeja_IN1, HIGH);
            analogWrite(bandeja_IN2, LOW);
            analogWrite(bandeja_PWM, bandeja_RPM);
            statusLED(BLUE);
            break;

        case OFF:
            // Desativa rotao bandeja
            analogWrite(bandeija_IN1, LOW);
            analogWrite(bandeija_IN2, LOW);
            analogWrite(bandeija_PWM, 0);
            statusLED(GREEN);
            break;
        
        case REVERSE:
            // Inverte o sentido de rotao
            analogWrite(bandeja_IN1, LOW);
            analogWrite(bandeja_IN2, HIGH);
            analogWrite(bandeja_PWM, B_LOW);
            statusLED(YELLOW);
            delay(2500);
            break;

        default:
            break;
    }
}

void correnteBandeja() 
{
    float tensao;
    unsigned int x = 0;
    float   valorACS   = 0.0,
            amostra    = 0.0,
            mediaACS     = 0.0,
            valorACS2  = 0.0;

    for (int x = 0; x < 10; x++)                // Coletar 10 amostras
    {
        valorACS = analogRead(ACS);              // Leitura de corrente   
        amostra = amosta + valorACS;            // Somatrio amostras
        delay (3);                              // Delay at prx amostra
    }
    mediaACS=amostra/10.0;                      // Mdia das amotras
    tensao=mediaACS*(5.0 / 1024.0);             //((mediaACS * (5.0 / 1024.0)) converso da leitura para 0-5V
    valorACS2 = (2.5 - tensao)*1000/0.185;      //2.5 offset,   0.185v is rise in output voltage when 1A current flows at input
    
    // Lgica
    if (valorACS2 >=  limCorrente){
        cntlBandeja(OFF);
        statusLED(RED);
        delay(100);
        cntlBandeja(REVERSE);
    }

    /* Debug
        Serial.print("Raw Voltage:");
        Serial.print(tensao);
        Serial.print("\t");
        Serial.print("Motor Current :");
        Serial.print(valorACS2);                    //Print no monitor serial
        Serial.println(" mA");
    */
}

void cntlMotores(bool status, int RPM, int topspin, int underspin)
{
    switch(status)
    {
        case TRUE:
            analogWrite(m_inf_PWM, (RPM * underspin));              // Motor inferior
            analogWrite(m_sup_PWM, (RPM * topspin));                // Motor superior
            statusLED(BLUE);
            break;
        
        case FALSE:
            analogWrite(m_inf_PWM, 0);                  // Motor inferior
            analogWrite(m_sup_PWM, 0);                  // Motor superior
            statusLED(GREEN);
            break;

        default:
            break;
    }

}

int contLancamento()
{
    int valorTCRT = analogRead(TCRT);

    if(valorTCRT < limTCRT)
    {
        global_counter++;
    }

    /* Debug
        Serial.print("Raw Value:");
        Serial.print(valorTCRT);
        Serial.print("\t");
        Serial.print("Contador :");
        Serial.print(global_counter);                    //Print no monitor serial
    */
    return global_counter;
}

bool cntlLancamento()               
{
    int aux1 = contLancamento();
    delay(3000);
    int aux2 = contLancamento();

    if ( aux2 > aux1 )
    {
        return TRUE;                // Continua a lanar
    }
    else 
    {
        return FALSE;               // Parou de lanar
    }
}

void statusLED(LED status)
{
    switch(status)
    {
        case RED:
            digitalWrite(LED_G, LOW);
            digitalWrite(LED_B, LOW);
            digitalWrite(LED_R, HIGH);
            break;
        
        case GREEN:
            digitalWrite(LED_G, HIGH);
            digitalWrite(LED_B, LOW);
            digitalWrite(LED_R, LOW);
            break;
        
        case BLUE:
            digitalWrite(LED_G, LOW);
            digitalWrite(LED_B, HIGH);
            digitalWrite(LED_R, LOW);
            break;
        
        case YELLOW:
            digitalWrite(LED_G, HIGH);
            digitalWrite(LED_B, LOW);
            digitalWrite(LED_R, HIGH);
            break;

        case CYAN:
            digitalWrite(LED_G, HIGH);
            digitalWrite(LED_B, HIGH);
            digitalWrite(LED_R, LOW);
            break;

        case PURPLE:
            digitalWrite(LED_G, LOW);
            digitalWrite(LED_B, HIGH);
            digitalWrite(LED_R, HIGH);
            break;
        
        default:
            digitalWrite(LED_G, LOW);
            digitalWrite(LED_B, LOW);
            digitalWrite(LED_R, LOW);
            break;
    }
}

