void cntlVertical(int inclinacao)
{    
    switch(inclinacao)
        {
            case I_NONE:
               if(global_vertical_pos == I_UPUP)
                {
                    stepperVertical.step(DOWN);         // Retorna ao UP
                    delay(500);
                    stepperVertical.step(DOWN);         // Retorna ao 0
                    delay(500);
                    set_global_vertical_pos(I_NONE);
                }
                else if (global_vertical_pos == I_UP)
                {
                    stepperVertical.step(DOWN);         // Retorna ao 0
                    delay(500);
                    set_global_vertical_pos(I_NONE);
                }
                else if (global_vertical_pos == I_NONE)
                {
                    set_global_vertical_pos(I_NONE);    // Mantm
                }
                else if (global_vertical_pos == I_DOWN)
                {
                    stepperVertical.step(UP);           // Retorna ao 0
                    delay(500);
                    set_global_vertical_pos(I_NONE);
                }
                else if (global_vertical_pos == I_DOWNDOWN)
                {
                    stepperVertical.step(UP);           // Retorna ao DOWN
                    delay(500);
                    stepperVertical.step(UP);           // Retorna ao 0
                    delay(500);
                    set_global_vertical_pos(I_NONE);
                }
                break;
                
            case I_UPUP:
                if(global_vertical_pos == I_UPUP)
                {
                    set_global_vertical_pos(I_UPUP);    // Mantm UPUP
                }
                else if (global_vertical_pos == I_UP)
                {
                    stepperVertical.step(UP);           // Avana ao UPUP
                    delay(500);
                    set_global_vertical_pos(I_UPUP);
                }
