/**
 * Definition for a binary tree node.
 * struct TreeNode {
 *     int val;
 *     TreeNode *left;
 *     TreeNode *right;
 *     TreeNode() : val(0), left(nullptr), right(nullptr) {}
 *     TreeNode(int x) : val(x), left(nullptr), right(nullptr) {}
 *     TreeNode(int x, TreeNode *left, TreeNode *right) : val(x), left(left), right(right) {}
 * };
 */
class Solution {
public:
    vector<vector<int>> levelOrder(TreeNode* root) {
        vector<vector<int>> res;
        if (root==NULL) return res;
        int h = 0;
        queue<TreeNode*> q;
        q.push(root);
        while (!q.empty()){
            vector<int> tmp;
            int size = q.size();
            for (int i = 0; i < size; ++i) {
                TreeNode* cur = q.front();
                q.pop();
                if (cur->left) q.push(cur->left);
                if (cur->right) q.push(cur->right);
                tmp.push_back(cur->val);
            }
            res.push_back(tmp);
        }
        return res;
    }
};

function treasureHunt(input) {
    let chest = input.shift().split('|');

    while (true) {
        tokens = input.shift().split(' ');
        let command = tokens.shift();
        if (command === "Yohoho!") {
            break;
        } else if (command === "Loot") {
            for (let i = 0; i < tokens.length; i++) {
                if (!chest.includes(tokens[i])) {
                    chest.unshift(tokens[i]);
                }
            }
        } else if (command === "Drop") {
            let index = Number(tokens);
            if (index >= 0 && index < chest.length) {
                chest.push(chest.splice(index, 1));
            }
        } else if (command === "Steal") {
            let count = Number(tokens);
            let stolenChest = chest.splice(-count);
            console.log(stolenChest.join(", "));
        }
    }

    if (chest.length === 0) {
        console.log("Failed treasure hunt.");
    } else {
        console.log(`Average treasure gain: ${((chest.join('').length) / chest.length).toFixed(2)} pirate credits.`);
    }
    return;
}

/**
 * Definition for a binary tree node.
 * struct TreeNode {
 *     int val;
 *     TreeNode *left;
 *     TreeNode *right;
 *     TreeNode() : val(0), left(nullptr), right(nullptr) {}
 *     TreeNode(int x) : val(x), left(nullptr), right(nullptr) {}
 *     TreeNode(int x, TreeNode *left, TreeNode *right) : val(x), left(left), right(right) {}
 * };
 */
class Solution {
public:
    int diameterOfBinaryTree(TreeNode* root) {
        int res = 0;
        helper(root, res);
        return res;
    }
    int helper(TreeNode* node, int &res){
        if (node==NULL) return 0;
        int lh = helper(node->left, res);
        int rh = helper(node->right, res);
        res = max(res, lh + rh);
        return max(lh, rh) + 1;
    }
};

class MyHashMap {
    struct Item {
        int key; 
        int value;
        Item* nxt = NULL;
        Item (int k, int v, Item* n){
            key = k;
            value = v;
            nxt = n;
        }
    };
    const static int size = 19997;
    Item* arr[size] = {NULL};

    int hash(int key){
        return key % size;
    }
public:
    MyHashMap() {
        
    }

    void put(int key, int value) {
        remove(key);
        int h = hash(key);
        Item* item = new Item(key, value, arr[h]);
        arr[h] = item;
    }
    
    int get(int key) {
        int h = hash(key);
        Item* item = arr[h];
        for (; item != NULL; item = item->nxt){
            if (item->key == key) return item->value;
        }
        return -1;
    }
    
    void remove(int key) {
        int h = hash(key);
        Item* item = arr[h];
        if (item == NULL) return;
        if (item->key == key){
            arr[h] = item->nxt;
            delete item;
        } else{
            for (; item->nxt!= NULL; item = item->nxt){
                if (item->nxt->key==key){
                    Item* tmp = item->nxt;
                    item->nxt = tmp->nxt;
                    delete tmp;
                    return;
                }
            }
        }
    }
    void print(){
        for (int i = 0; i < size; ++i) {
            if (arr[i] != NULL) {
                cout << arr[i]-> key << ":" << arr[i]->value <<"\n";
            }
        }
    }
};

